        <Link href="/"><a>프로필</a></Link>
        <Link href="/"><a>회원가입</a></Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
